import axios from "axios";
const PUBLICKEY = "cb68fc2ec155c195822ef51f03beb395";
const PRIVATEKEY = "12ae1f4be3a7ee1916245e66d313f38211fb9302";
const BASEURL = "http://gateway.marvel.com/v1/public/comics?ts=1&apikey="+PUBLICKEY+"&hash="
library(digest)
hash <- digest(paste0(ts, PRIVATEKEY, PUBLICKEY), algo="md5")
console.log(hash);



export default {
  search: function(query) {
    return axios.get(BASEURL + query + APIKEY);
  }
};
